[AssParade] Jada Stevens, Kelly Welch (Big Ass Haunted Mansion)

Ruh-roh, Shaggy! It's Halloween time, and you know what that means! No...not slutty girls in slutty costumes. (Okay, yes, also slutty girls in slutty costumes) But it means haunted mansions! Today on Assparade, the Scooby gang gets the chance to check out this freaky mansion on South Beach. Daphne (Jada Stevens) and Velma (Kelly Welch) are better looking than they were when I watched them as a kid! They've got big ol' butts and they're a lot of fun to look at and play with. And I'm not sure that I've seen every Scooby-Doo show but I'm certain that Shaggy and Fred never got this lucky in the Mystery Machine van! Watch this video and then go out to a haunted house with some fine ladies. Who knows, maybe you'll get lucky like Fred and Shaggy did! Or maybe you'll get spooked by Old Man Preston Parker. Happy Halloween!

